drop procedure if exists addColumnToPartnerApp;
USE b'junhua630';
CREATE DEFINER=`root`@`%` PROCEDURE `addColumnToPartnerApp`()
BEGIN
    declare clmCreator varchar(500);
    declare schema_name varchar(500);

    set @clmCreator = 'alter table `partner_app` add column `create_partner_id` int COMMENT "APP创建人id"';

    SELECT db into @schema_name from information_schema.processlist where info like '%infOrmation_shcema.processlist%' limit 1;

    select count(*) into @countClmCreator from information_schema.COLUMNS where table_schema = @schema_name and  table_name = 'partner_app' and column_name = 'create_partner_id';
    if @countClmCreator < 1 then
      PREPARE stmt FROM @clmCreator;
      EXECUTE stmt ;
    end if;

END;
USE b'junhua630';
alter table `partner_app` add column `create_partner_id` int COMMENT "APP创建人id";
USE b'junhua630';
DROP PROCEDURE IF EXISTS add_idx_kc_uuid_for_user_company;
USE b'junhua630';
CREATE DEFINER=`root`@`%` PROCEDURE `add_idx_kc_uuid_for_user_company`()
begin
  DECLARE add_index VARCHAR(250);

  set @add_index='create index `idx__kc_uuid` using hash on `user_company`(`kc_uuid`)';
  select count(*) into @idx_count from information_schema.statistics where table_schema =
    (select db from information_schema.processlist where info like '%information_schema%')
    and table_name = 'user_company' and index_name = 'idx__kc_uuid';

  if @idx_count = 0 then
    PREPARE addIndex FROM @add_index;
    EXECUTE addIndex ;
  end if;

end;
USE b'junhua630';
create index `idx__kc_uuid` using hash on `user_company`(`kc_uuid`);
